import React from "react";
import AnimalCard from "./AnimalCard";
import animalData from "./data";

function App() {
  return (
    <div>
      <h1>Animal Information</h1>
      {animalData.map((animal) => (
        <AnimalCard
          key={animal.name}
          name={animal.name}
          scientificName={animal.scientificName}
          size={animal.size}
          diet={animal.diet}
          additional={animal.additional}
        />
      ))}
    </div>
  );
}

export default App;
